export default function profiles({img}) {
  return (
    <div>
      <div className="profile">
          <img src={img} className="photo"></img>
          <h2>라이언</h2>
          <p>덩치는 크지만 마음은 여린 수사자</p>
        </div>
    </div>
  )
}
